var n_bodies = 4
var positions = []
var velocities = []
for(var i = 0; i < n_bodies; i++) {
  var theta = i*Math.PI*2./n_bodies
  var radius = 5.;
  var x = Math.cos(theta)*radius
  var z = Math.sin(theta)*radius
  var vx = Math.cos(theta-Math.PI/2.)*2
  var vz = Math.sin(theta-Math.PI/2.)*2

  positions.push([x, 0., z, 2.])
  velocities.push([vx, 0., vz, 0.])
}

