  var new_time = (new Date().getTime()-window.startTime)/1E3;
  if(!window.time_elapsed) window.time_elapsed = 0;
  window.delta_time = new_time-window.time_elapsed
  window.time_elapsed = new_time

  positions.forEach((pos, index)=>{
    vec4.scaleAndAdd(pos, pos, velocities[index], window.delta_time)
  })

